import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <form>
    <label>
      Name:
      <input class='answer' type="text" name="name" />
    </label>
    <input type="submit" value="Submit" />
  </form>
  );
}

export default App;
